import firebase from "firebase/compat/app";
import "firebase/compat/auth";
const app = firebase.initializeApp({
    apiKey: process.env.REACT_APP_API_KEY || 'dsa',
    authDomain: process.env.REACT_APP_AUTH_DOMAIN || 'sda',
    projectId: process.env.REACT_APP_PROJECT_ID || 'dsa',
    storageBucket: process.env.REACT_APP_STORAGE_BUCKET || 'dsads',
    messagingSenderId: process.env.REACT_APP_MESSAGING_SENDER_ID || 'sdsa',
    appId: process.env.REACT_APP_APP_ID || '134343'
});

export const auth = app.auth();
export default app
